import React, { useEffect, useState } from "react";
import axios from "axios";

export default function ShowBrand() {
  var [brand, setBrand] = useState([]);

  useEffect(() => {
    console.log("Call Branch API.");
  });
  axios
    .post("http://localhost:8080/show-brands")
    .then((result) => {
      console.log(result.data);
      setBrand(result.data);
    })
    .catch((error) => {
      console.log(error);
    });
  return (
    <div>
      <ul>
        {brand &&
          brand.map((values) => {
            <li> {values.name}</li>;
          })}
      </ul>
    </div>
  );
}
